import {useState, useEffect} from 'react'

 function Card() {
    useEffect(() => {
        fetch(new Request(`logements.json`))
             .then((response) => response.json()
             .then(({ logements }) => console.log(logements))
             .catch((error) => console.log(error))
         )
     }, [])
     return(
        <div>coucou</div>
     )
 }

 export default Card
